// D:\RoomieRadar\frontend\src\index.js
// Entry point for RoomieRadar Frontend

import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import App from "./App";
import "./styles/variables.css";
import "./styles/global.css";
// Optional: import global CSS / Tailwind
import "./styles/global.css";

// Log to verify frontend bundle is running
console.log("RoomieRadar Frontend is running");

// Get root container
const container = document.getElementById("root");

if (!container) {
  throw new Error("Root container (#root) not found in index.html");
}

// Create React root (React 18+)
const root = ReactDOM.createRoot(container);

// Render React app with React Router support
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);

// Optional: Webpack Hot Module Replacement
if (module.hot) {
  module.hot.accept();
}
